using De.Osthus.Ambeth.Appendable;
using De.Osthus.Ambeth.Xml.Namehandler;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using System.IO;
using System.Text;
using System.Xml;

namespace De.Osthus.Ambeth.Xml.Test
{
	[TestClass]
	public class StringNameHandlerTest
	{
		private const String PREFIX = "<s i=\"1\"><![CDATA[";

		private const String POSTFIX = "]]></s>";

		private StringNameHandler stringNameHandler;

		private DefaultXmlWriter writer;

		private ICyclicXmlDictionary xmlDictionary;

		private StringBuilder sb;

		[TestInitialize]
		public void SetUp()
		{
			stringNameHandler = new StringNameHandler();

			xmlDictionary = new CyclicXmlDictionary();
			stringNameHandler.XmlDictionary = xmlDictionary;

			sb = new StringBuilder();
			writer = new DefaultXmlWriter(new AppendableStringBuilder(sb), null);
		}

		[TestMethod]
		public virtual void TestWritesCustom1()
		{
			String input = "Lorem ipsum dolor sit amet, consetetur sadipscing elitr, ...";
			String expected = PREFIX + input + POSTFIX;
			stringNameHandler.WritesCustom(input, typeof(String), writer);
			String written = sb.ToString();
			Assert.IsNotNull(written);
			Assert.AreEqual(expected, written);
		}

		[TestMethod]
		public virtual void TestWritesCustom2()
		{
			String input = "Lorem ipsum dolor sit [[amet,]] consetetur [[sadipscing]] elitr, ...";
			String expected = PREFIX + input + POSTFIX;
			stringNameHandler.WritesCustom(input, typeof(String), writer);
			String written = sb.ToString();
			Assert.IsNotNull(written);
			Assert.AreEqual(expected, written);
		}

		[TestMethod]
		public virtual void TestReadObject1()
		{
			String input = "Lorem ipsum dolor sit amet, consetetur sadipscing elitr, ...";
			stringNameHandler.WritesCustom(input, typeof(String), writer);
			String written = sb.ToString();
			IReader reader = createXmlReader(written);
			Object read = stringNameHandler.ReadObject(typeof(String), "s", 1, reader);
			Assert.IsNotNull(read);
			Assert.IsTrue(read is String);
			Assert.AreEqual(input, read);
		}

		[TestMethod]
		public virtual void TestReadObject2()
		{
			String input = "Lorem ipsum dolor sit [[amet,]] consetetur [[sadipscing]] elitr, ...";
			stringNameHandler.WritesCustom(input, typeof(String), writer);
			String written = sb.ToString();
			IReader reader = createXmlReader(written);
			Object read = stringNameHandler.ReadObject(typeof(String), "s", 1, reader);
			Assert.IsNotNull(read);
			Assert.IsTrue(read is String);
			Assert.AreEqual(input, read);
		}

		[TestMethod]
		public virtual void TestWritesCustom_cdataEnd()
		{
			String input = "Lorem ipsum dolor sit <![CDATA[amet,]]> consetetur <![CDATA[sadipscing]]> elitr, ...";
			String expected = "<s i=\"1\"><s><![CDATA[Lorem ipsum dolor sit <![CDATA[amet,]]]]></s><s><![CDATA[> consetetur <![CDATA[sadipscing]]]]></s><s><![CDATA[> elitr, ...]]></s></s>";
			stringNameHandler.WritesCustom(input, typeof(String), writer);
			String written = sb.ToString();
			Assert.IsNotNull(written);
			Assert.AreEqual(expected, written);
		}

		[TestMethod]
		public virtual void TestReadObject_cdataEnd()
		{
			String input = "Lorem ipsum dolor sit <![CDATA[amet,]]> consetetur <![CDATA[sadipscing]]> elitr, ...";
			stringNameHandler.WritesCustom(input, typeof(String), writer);
			String written = sb.ToString();
			IReader reader = createXmlReader(written);
			Object read = stringNameHandler.ReadObject(typeof(String), "s", 1, reader);
			Assert.IsNotNull(read);
			Assert.IsTrue(read is String);
			Assert.AreEqual(input, read);
		}

		[TestMethod]
		public virtual void TestWritesCustom_veryLongXml()
		{
			stringNameHandler.WritesCustom(veryLongXml, typeof(String), writer);
			String result = sb.ToString();
			Assert.AreEqual(expectedRes, result);
		}

		[TestMethod]
		public virtual void TestReadObject_veryLongXml()
		{
			stringNameHandler.WritesCustom(veryLongXml, typeof(String), writer);
			String written = sb.ToString();
			IReader reader = createXmlReader(written);
			Object read = stringNameHandler.ReadObject(typeof(String), "s", 1, reader);
			Assert.IsNotNull(read);
			Assert.IsTrue(read is String);
			Assert.AreEqual(veryLongXml, read);
		}

		private IReader createXmlReader(String xmlContent)
		{
			TextReader textReader = new StringReader(xmlContent);
			XmlReaderSettings settings = new XmlReaderSettings();
			settings.IgnoreWhitespace = true;
			settings.DtdProcessing = DtdProcessing.Prohibit;
			//settings.ValidationType = ValidationType.None;
			settings.XmlResolver = null;

			XmlReader xmlReader = XmlReader.Create(textReader, settings);

			IReader reader = new DefaultXmlReader(xmlReader, null, null);

			return reader;
		}

